import React from 'react'
import { Container, Row, Col } from "reactstrap";

const Login = () => {
  return (
    <div className="container-login align-items-center justify-content-center">
        <Col lg='5'>
          Đăng nhập
          <input type="text" name="" id="" />
        </Col>
    </div>
  )
}

export default Login
